import axios from 'axios';
import {axiosPrivate} from "../api/axios";

export class RolService {

    getProductsSmall() {
        return axios.get('assets/demo/data/products-small.json').then(res => res.data.data);
    }

    getRols(id) {
       const token = JSON.parse(sessionStorage.getItem('token'));
        /*  const configToken = { headers: {"Authorization" : `Bearer ${token}`}};
         console.log("token dddd");
         console.log(configToken);
        // return axios.get('assets/demo/data/rols.json').then(res => res.data.data);*/
        var axios = require('axios');

        var config = {
            method: 'get',
            url: 'localhost:8090/api/aplicacion/1/rol/list',
            headers: {
                'Authorization': 'Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJBRE1JTiIsImlhdCI6MTY1NzMxMDk5MiwiZXhwIjoxNjU3OTE1NzkyfQ.QFUOWVXawOlaOtApwH9u3zm08RPBNO9RsUD-nrDHLtgLSYTC8b4qcvVYp-tHjJSXwcrJY2aqLKelHy1tOQkjcg'
            }
        };

        axios(config)
            .then(function (response) {
                console.log(JSON.stringify(response.data));
            })
            .catch(function (error) {
                console.log(error);
            });

        return axiosPrivate.get('aplicacion/'+ id +'/rol/list',{ headers: {"Authorization" : `Bearer ${token}`}}).then(res => res.data);
    }

    getProductsWithOrdersSmall() {
        return axios.get('assets/demo/data/products-orders-small.json').then(res => res.data.data);
    }
}
